import React, { useEffect, useState } from "react";
import StudentModal from "../modals/StudentModal";
import ListItems from "../admin/ListItems";
import Spinner from "../global/Spinner";

export const StudentPage = ({ studentid }) => {
  const [data, setData] = useState({});
  const [isDataFetched, setIsDataFetched] = useState(false);

  const getStudent = async () => {
    try {
      const response = await fetch(
        `${process.env.REACT_APP_SERVERURL}/students/${studentid}`
      );
      const json = await response.json();
      if (response.status === 200) {
        setData(json);
        setIsDataFetched(true);
      }
    } catch (error) {
      console.log(error.detail);
    }
  };

  // studentId={data.studentid}
  // firstname={data.firstname}
  // lastname={data.lastname}
  // city={data.city}
  // dob={data.dateofbirth}
  // phone={data.phone}
  // email={data.email}

  useEffect(() => {
    getStudent();
  }, []);

  const handleChange = (e) => {
    const {name,value} = e.target;
    
    setData((data)=>({
      ...data,
      [name]:value
    }))
  };

  console.log(data);
  return (
    <>
      {isDataFetched ? (
        <div className="container w-50 ">
          <div className="row">
            <div className="col-lg-12 col-md-12 col-xs-12">
              <p>Welcome {data.firstname + " " + data.lastname}</p>
            </div>
          </div>
          <div className="row w-75">
            <div className="col-lg-4 col-md-4 col-xs-4 d-flex justfify-content-center flex-column">
              <label>Student ID</label>
              <input type="text" value={data.studentid} disabled onChange={(e)=>handleChange(e)} />
            </div>
            <div className="col-lg-4 col-md-4 col-xs-4 d-flex justfify-content-center flex-column">
              <label>First Name</label>
              <input type="text" value={data.firstname}  onChange={(e)=>handleChange(e)} />
            </div>
            <div className="col-lg-4 col-md-4 col-xs-4 d-flex justfify-content-center flex-column">
              <label>Last Name</label>
              <input type="text" value={data.lastname}  onChange={(e)=>handleChange(e)} />
            </div>
          </div>
          <div className="row w-75">
            {" "}
            <div className="col-lg-3 col-md-3 col-xs-3 d-flex justfify-content-center flex-column ">
              <label>City</label>
              <input type="text" value={data.city}  onChange={(e)=>handleChange(e)} />
            </div>
            <div className="col-lg-3 col-md-3 col-xs-3 d-flex justfify-content-center flex-column">
              <label>Birthdate</label>
              <input type="text" value={data.dateofbirth}  onChange={(e)=>handleChange(e)} />
            </div>
            <div className="col-lg-3 col-md-3 col-xs-3 d-flex justfify-content-center flex-column">
              <label>Phone</label>
              <input type="text" value={data.phone} maxLength={10} onChange={(e)=>handleChange(e)} />
            </div>
            <div className="col-lg-3 col-md-3 col-xs-3 d-flex justfify-content-center flex-column">
              <label>Email</label>
              <input type="text" value={data.email}  onChange={(e)=>handleChange(e)} />
            </div>
          </div>
        </div>
      ) : (
        <Spinner />
      )}
    </>
  );
};
